import React, { Component } from "react";
import { TextInput, Row, Col, Button, Icon } from "react-materialize";
class Login extends Component {
    render() {
        return (
            <div>
                <Row>
                    <Col m={4}></Col>
                    <Col m={4}>
                        <h3> Login</h3>
                    </Col>
                    <Col m={4}></Col>
                </Row>

                    <form method='POST' className="col s12">



                                    <TextInput className="col s12" email label='Email' validate />


                                <TextInput label='Password' password />

                                <Button node='button' waves='light'>
                                    Login
                                    <Icon right>cloud</Icon>
                                </Button>


                    </form>

            </div>
        );
    }
}
export default Login;
